// frontend/src/pages/Login.jsx
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Login.css';

const Login = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const navigate = useNavigate();

  const handleLogin = async (e) => {
    e.preventDefault();
    setError('');
    setLoading(true);

    // محاكاة اتصال بالخادم
    setTimeout(() => {
      const testUsers = {
        'admin@l3bty.com': {
          id: 1,
          name: 'المدير العام',
          email: 'admin@l3bty.com',
          role: 'admin',
          branch_id: 1,
          branch_name: 'الفرع الرئيسي'
        },
        'manager1@l3bty.com': {
          id: 2,
          name: 'أحمد محمد',
          email: 'manager1@l3bty.com',
          role: 'branch_manager',
          branch_id: 1,
          branch_name: 'غازي مول'
        },
        'employee1@l3bty.com': {
          id: 3,
          name: 'محمد أحمد',
          email: 'employee1@l3bty.com',
          role: 'employee',
          branch_id: 1,
          branch_name: 'غازي مول'
        }
      };

      // التحقق من كلمة المرور
      if (password !== '123456') {
        setError('كلمة المرور غير صحيحة');
        setLoading(false);
        return;
      }

      const user = testUsers[email];
      if (!user) {
        setError('البريد الإلكتروني غير موجود');
        setLoading(false);
        return;
      }

      // حفظ بيانات المستخدم
      const token = `l3bty-token-${Date.now()}`;
      localStorage.setItem('token', token);
      localStorage.setItem('user', JSON.stringify(user));

      setLoading(false);
      
      // الانتقال للصفحة الرئيسية
      navigate('/dashboard');
      
    }, 1000);
  };

  return (
    <div className="login-container">
      <div className="login-card">
        <div className="login-header">
          <img 
            src="/images/logol3bty.jpg" 
            alt="L3BTY Logo" 
            className="login-logo"
          />
          <h1>نظام تأجير L3BTY</h1>
          <p className="login-subtitle">سجل دخولك للوصول للنظام</p>
        </div>

        {error && (
          <div className="alert alert-danger">
            {error}
          </div>
        )}

        <form onSubmit={handleLogin} className="login-form">
          <div className="form-group">
            <label htmlFor="email">البريد الإلكتروني</label>
            <input
              type="email"
              id="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              placeholder="ادخل بريدك الإلكتروني"
              required
              className="form-control"
            />
          </div>

          <div className="form-group">
            <label htmlFor="password">كلمة المرور</label>
            <input
              type="password"
              id="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              placeholder="ادخل كلمة المرور"
              required
              className="form-control"
            />
          </div>

          <button 
            type="submit" 
            className="btn-login"
            disabled={loading}
          >
            {loading ? (
              <>
                <span className="spinner"></span>
                جاري تسجيل الدخول...
              </>
            ) : 'تسجيل الدخول'}
          </button>
        </form>

        <div className="login-footer">
          <div className="test-credentials">
            <h4>بيانات اختبار:</h4>
            <div className="credentials-list">
              <div className="credential-item">
                <strong>المدير العام:</strong>
                <span>admin@l3bty.com</span>
                <span>123456</span>
              </div>
              <div className="credential-item">
                <strong>مدير فرع:</strong>
                <span>manager1@l3bty.com</span>
                <span>123456</span>
              </div>
              <div className="credential-item">
                <strong>موظف:</strong>
                <span>employee1@l3bty.com</span>
                <span>123456</span>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Login;
